    if (loginRole === 'admin') {
      return (
        <div className="dark">
          {routing}
          admin
        </div>
      );
    } else if (loginRole === 'publisher') {
      return (
        <div className="dark">
          {routing}
          publisher
        </div>
      );
    } else {
      return (
        <div className="dark">
          {routingLogout}
        </div>
      );
    }
  } else {
    return (
      <div className="dark">
        {routingLogout}
      </div>
    );
  }

};

export default App;
